import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  flex: 1;
  flex-direction: column;
  font-family: Arial, sans-serif;
  font-size: 14px;

  height: 100vh;

  border: 1px solid #43ff;
  justify-content: space-between;
`;

export const ListItens = styled.ul`
  background: green;
  display: flex;
  flex: 1;
  flex-direction: column;
  justify-content: space-between;
  height: 90vh;

  #deep {
    display: block;
    background: red;
  }

  li {
    display: flex;
    align-items: center;
    padding: 10px 10px;
    color: #fff;

    &:hover {
      background-color: #434c5b;
    }

    a {
      padding-left: 10px;
      text-decoration: none;
      color: #eee;
    }
  }
`;
